type propsType = {
    events: {
        id: number;
        text: string;
        date: string;
    };
};

const Events: React.FunctionComponent<propsType> = (eventsList) => {

    const { events } = eventsList;

    return (
        <>
            {eventsList.map((event) => (
                <h3 key={event.id}>{event.text}</h3>
            ))}
        </>
    )
}

export default Events
